import './loginComponent.css'
import {useState, useEffect} from 'react'

const LoginComponent = () => {

    const [loginHeader, setLoginHeader ] = useState('')

    useEffect(()=>{
        setLoginHeader('login')
    },[])

    function headerChange(value){
        console.log(value)
    }

  return (
    <div className='login-right'>
        <div className="login-header">
            <button onClick={()=>{headerChange('login')}} className={loginHeader === 'login' ? 'login-header-active':''}>Login</button>
            <button className={loginHeader === 'singup' ? 'login-header-active':''}>Cadastrar</button>
        </div>
        <div className="login-form"></div>
        <div className="singup-form"></div>
    </div>
  )
}

export default LoginComponent
